new class{Controller(t,o){this.model=t,this.view=o}}(new class{constructor(){this.todos=[{id:1,text:"init node",complete:!1},{id:2,text:"init webpack",complete:!1}]}addTodo(t){const o={id:this.todos.length>0?this.todos[this.todos.length-1].id+1:1,text:t,complete:!1};this.todos.push(o)}editTodo(t,o){this.todos=this.todos.map((e=>e.id===t?{id:e.id,text:o,complete:e.complete}:e))}deleteTodo(t){this.todos=this.todos.filter((o=>o.id!==t))}toggleTodo(t){this.todos=this.todos.map((o=>o.id===t?{id:o.id,text:o.text,completr:!o.complete}:o))}},new class{constructor(){}});